import torch
import torch.nn as nn
import torchvision
import torchvision.transforms as transforms

torch.cuda.empty_cache()

import gc
gc.collect()

device = torch.device('cuda' if torch.cuda.is_available() else 'cpu')

num_epochs = 1
learning_rate = 0.001

train_dataset = torchvision.datasets.CIFAR10(root='../../data/',
                                             train=True,
                                             transform=transforms.ToTensor(),
                                             download=True)

test_dataset = torchvision.datasets.CIFAR10(root='../../data/',
                                            train=False,
                                            transform=transforms.ToTensor())

train_loader = torch.utils.data.DataLoader(dataset=train_dataset,
                                           batch_size=32,
                                           shuffle=True)

test_loader = torch.utils.data.DataLoader(dataset=test_dataset,
                                          batch_size=32,
                                          shuffle=False)

mean_R, mean_G, mean_B = 0, 0, 0
std_R, std_G, std_B = 0, 0, 0

for images, _ in train_loader:
    mean_R += torch.mean(images[:, 0, :, :])
    mean_G += torch.mean(images[:, 1, :, :])
    mean_B += torch.mean(images[:, 2, :, :])
    std_R += torch.std(images[:, 0, :, :])
    std_G += torch.std(images[:, 1, :, :])
    std_B += torch.std(images[:, 2, :, :])

mean_R /= len(train_loader)
mean_G /= len(train_loader)
mean_B /= len(train_loader)
std_R /= len(train_loader)
std_G /= len(train_loader)
std_B /= len(train_loader)

#Data augumentation
transform_train = transforms.Compose([

    transforms.Pad(4),
    transforms.RandomHorizontalFlip(),
    transforms.RandomCrop(32),
    transforms.ToTensor(),
    transforms.Normalize(mean=[mean_R, mean_G, mean_B],
                         std=[std_R, std_G, std_B])
])

transform_test = transforms.Compose([
    transforms.ToTensor(),
    transforms.Normalize(mean=[mean_R, mean_G, mean_G],
                         std=[std_R, std_G, std_B])
])

train_dataset.transform = transform_train
test_dataset.transform = transform_test

train_loader = torch.utils.data.DataLoader(dataset=train_dataset,
                                           batch_size=32,
                                           shuffle=True)

test_loader = torch.utils.data.DataLoader(dataset=test_dataset,
                                          batch_size=32,
                                          shuffle=False)

import torch.nn as nn

class AlexNet(nn.Module):
    def __init__(self):
        super(AlexNet, self).__init__()
        self.features = nn.Sequential(
            #Conv2d(입력채널수, 출력채널수, 필터 크기)
            nn.Conv2d(3,64,kernel_size=3),
            nn.ReLU(),
            nn.MaxPool2d(2,2),
            nn.Conv2d(64, 192, kernel_size=3, padding=1),
            nn.ReLU(),
            nn.MaxPool2d(2,2),
            nn.Conv2d(192, 384, kernel_size=3, padding=1),
            nn.ReLU(),
            nn.Conv2d(384, 256, kernel_size=3, padding=1),
            nn.ReLU(),
            nn.Conv2d(256, 256, kernel_size=1),
            nn.ReLU(),
            nn.MaxPool2d(2,2)


            )

        #FC 구축
        self.classifier = nn.Sequential(


            nn.Dropout(0.5),
            nn.Linear(256*3*3, 1024),
            nn.ReLU(),
            nn.Dropout(0.5),
            nn.Linear(1024,512),
            nn.ReLU(),
            nn.Linear(512,10)


            )

    def forward(self, x):
        x = self.features(x)
        x = x.view(-1, 256*3*3)
        x = self.classifier(x)
        return x

model = AlexNet().to(device)

criterion = nn.CrossEntropyLoss()
optimizer = torch.optim.Adam(model.parameters(), lr=learning_rate)

def update_lr(optimizer, lr):
    for param_group in optimizer.param_groups:
        param_group['lr'] = lr

total_step = len(train_loader)
curr_lr = learning_rate

def train(epoch):
    model.train()
    for i, (images, labels) in enumerate(train_loader):
        images = images.to(device)
        labels = labels.to(device)
        outputs = model(images)
        loss = criterion(outputs, labels)

        optimizer.zero_grad()
        loss.backward()
        optimizer.step()

        if (i+1) % 100 == 0:
            print("Epoch [{}/{}], step [{}/{}] Train Loss: {:.4f}".format(epoch+1, num_epochs, i+1, total_step, loss.item()))

def test():
    model.eval()
    with torch.no_grad():
        correct = 0
        total = 0
        test_loss = 0
        for images, labels in test_loader:
            images = images.to(device)
            labels = labels.to(device)
            outputs = model(images)
            _, predicted = torch.max(outputs.data, 1)
            total += labels.size(0)
            correct += (predicted == labels).sum().item()
            loss = criterion(outputs, labels)
            test_loss += loss.item()

        accuracy = 100 * correct / total
        print('Accuracy of the model on the test images: {} %'.format(accuracy))

for epoch in range(num_epochs):
    train(epoch)
    test()

